/*Table structure for table `wy_resident_info` */

DROP TABLE IF EXISTS `wy_resident_info`;

CREATE TABLE `wy_resident_info` (
  `user_id` bigint(20) NOT NULL COMMENT '用户内部id',
  `username` varchar(100) NOT NULL COMMENT '用户名',
  `nickname` varchar(100) DEFAULT NULL COMMENT '昵称',
  `resident_type` int(11) NOT NULL COMMENT '住户类型：1-业主，2-家人，3-朋友，4-租客',
  `avatar` varchar(1000) DEFAULT NULL COMMENT '用户头像',
  `sex` int(11) DEFAULT NULL COMMENT '性别：0-女，1-男',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `nation` varchar(200) DEFAULT NULL COMMENT '民族',
  `card_no` varchar(100) DEFAULT NULL COMMENT '身份证号码',
  `phone` varchar(50) NOT NULL COMMENT '联系电话（登录名）',
  `address` varchar(200) DEFAULT NULL COMMENT '联系地址',
  `company` varchar(200) DEFAULT NULL COMMENT '工作单位',
  `household_address` varchar(200) DEFAULT NULL COMMENT '户口所在地',
  `car_desc` varchar(255) DEFAULT NULL COMMENT '备注',
  `data_status` int(11) DEFAULT '1' COMMENT '删除标志：0-已删除，1-正常',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

